import Link from 'next/link'
import google from '../components/images/google.png'

const photo = require('../components/images/google.png');
const linkStyle = {
    marginRight: 15
}

export default function Header() {
    return (
        <div>
            <p>The footer is placed at the bottom
                of the Page IDIOT!!!
            </p>
            <img src={photo} />
        </div>
    )
}
